var isAlreadyProcessing=false;$("#warning-agree").on("submit",function(e){if(!isAlreadyProcessing){isAlreadyProcessing=true;$this=$(this);$.ajax({type:"POST",url:WARNING_TOOL_URL,dataType:"json",data:{warning:"read"},beforeSend:function(){$this.find("div.throbber").show()}}).done(function(e,t,n){switch(e.success){case false:alert(e.message);break;case true:$.colorbox.remove();break;default:}}).always(function(){isAlreadyProcessing=false;$this.find("div.throbber").hide()}).fail(function(e,t,n){if(t==="parsererror"){alert("Requested JSON parse failed.")}else if(t==="timeout"){alert("Time out error.")}else if(t==="abort"){alert("Ajax request aborted.")}else if(e.status===0){alert("Not connect.\n Verify Network.")}else if(e.status==404){alert("Requested page not found. [404]")}else if(e.status==500){alert("Internal Server Error [500].")}else{alert("Uncaught Error.\n"+e.responseText)}})}e.preventDefault()})